import { useLoaderData, useRouteLoaderData } from 'react-router-dom';
import EventsList from '../../components/EventsList';

function EventsPage() {
  const events = useRouteLoaderData();

  return (
    <>

      <EventsList events={events} />
    </>
  );
}

export default EventsPage;
